import React from 'react'
import styled from 'styled-components'

const NavBackground = styled.div`
  overflow-y: auto;
  overflow-x: hidden;
  width: -webkit-fill-available;

  z-index: 1;
  margin-bottom: 64px;
  ${({ theme }) => theme.mediaQueries.lg} {
    margin-bottom: 0;
  }
`

const NavBar = () => {
  return (
    <div>
      Testing
      <NavBackground />
    </div>
  )
}

export default NavBar
